package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  cat_data =""
)
var cat = &glui.ImageData{nil, 474, 625}
func load_cat() bool {
  b, err := base64.StdEncoding.DecodeString(cat_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  cat.Pix = c.Bytes()
  return true
}
var cat_loaded = load_cat()